(309, , 'Ben Affleck, Henry Cavill, Amy Adams, Scarlett Johansson, Idris Elba, Lupita Nyong''o, Mary Elizabeth Winstead, John Goodman, John Gallagher Jr., Shailene Woodley, Theo James, Zoë Kravitz, Chris Hemsworth, Charlize Theron, Emily Blunt, ', '2016-04-06', 114, 'Action', 5.5, 'Cedric Nicolas-Troyan', 'As two evil sisters prepare to conquer the land, two renegades - Eric the Huntsman - who previously aided Snow White in defeating Ravenna, and his forbidden lover, Sara, set out to stop them.', 'The Huntsman Winter''s War', '-5452406', 290595, '2016-04-10');
